css:
.nuclide-breakpoint-icon {
  text-align: center;
  display: block;
  width: 0.8em;
  color: #6494ed;
}
.nuclide-breakpoint-icon::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 130%;
  width: 130%;
  height: 130%;
  content: "\f052";
}
.nuclide-debugger-atom-shadow-breakpoint {
  text-align: center;
  display: block;
  width: 0.8em;
  color: rgba(100, 148, 237, 0.4);
}
.nuclide-debugger-atom-shadow-breakpoint:hover::before,
.nuclide-debugger-atom-shadow-breakpoint-icon::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 130%;
  width: 130%;
  height: 130%;
  content: "\f052";
}
.nuclide-current-line-highlight {
  background: linear-gradient(to bottom, rgba(0, 136, 255, 0.8) 0%, rgba(0, 136, 255, 0.8) 5%, rgba(0, 136, 255, 0.3) 5%, rgba(0, 136, 255, 0.3) 95%, rgba(0, 136, 255, 0.8) 95%, rgba(0, 136, 255, 0.8) 100%);
}
